IF OBJECT_ID('dbo.proc_transform_307', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_307;
GO
CREATE PROCEDURE dbo.proc_transform_307
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_307
    SET payload = LEFT(payload, 1000) + N'|V4-307|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_307;
END
